import React from 'react';
import Header from './Header';
import '../style/index.css';
import Index from './Index'
import '../style/dashboard.css'


const Dashboard = () => {
  return (
		<div>
			<Header />
			<div>
				<Index />
			</div>
			<div className='container'>
			<iframe src="https://discord.com/widget?id=695650077657661451&theme=dark" width="350" height="500" allowtransparency="true" frameborder="0" sandbox="allow-popups allow-popups-to-escape-sandbox allow-same-origin allow-scripts"></iframe>
			</div>
			<div><h1>Hello World</h1></div>
		</div>
	);
};

export default Dashboard;
